(def hpgdata 
  (->> (eapi/query-all driver [{:tag :table :fn/has-class "stock"}{:tag :tbody}{:tag :tr}])
       (rest)
       ;(take 2)
       (map (fn [in] 
              (->> 
                (eapi/children driver in {:tag :td})
                (map #(eapi/get-element-text-el driver %))
               )))))
