(def db-conf {:classname "org.h2.Driver"
              :subprotocol "h2"
              :subname "./resources/database.db"
              })
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;icy-meadow/db-conf</span>","value":"#'icy-meadow/db-conf"}
;; <=

;; @@
(defn create-db-prices
  []
  (try (jdbc/db-do-commands db-conf
           (jdbc/create-table-ddl :gcm_prices_mas
               [[:id :serial "NOT NULL" "AUTO_INCREMENT"]
                [:code :varchar "NOT NULL"]
                [:date :varchar "NOT NULL"]
                [:ref_pri :float]
                [:chg :float]
                [:chg_per :float]
                [:cls_pri :float]
                [:vol :float]
                [:opn_pri :float]
                [:hgt_pri :float]
                [:low_pri :float]
                [:vol_tt  :float]
                [:frg_buy :float]
                [:frg_sel :float]]
                                 ))
       (catch Exception e
         (println (.getMessage e)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;icy-meadow/create-db-prices</span>","value":"#'icy-meadow/create-db-prices"}
;; <=

;; @@
(defn drop-db-prices
  []
  (try (jdbc/db-do-commands db-conf
           (jdbc/drop-table-ddl :gcm_prices_mas)                 )
       (catch Exception e
         (println (.getMessage e)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;icy-meadow/drop-db-prices</span>","value":"#'icy-meadow/drop-db-prices"}
