;; @@
(->> 
     (take 5 hpgdata)
     (map (fn 
            [input]
            {:code "HPG"
             :date (->>
                     (nth input 1)
                     (f/parse (f/formatter "dd-mm-yyyy"))
                     (f/unparse (f/formatter "yyyymmdd")))
             :ref_pri (nth input 2)
             :chg (nth input 3)
             :chg_per (->
                        (nth input 4)
                        (str/replace "%" ""))
             :cls_pri (nth input 5)
             :vol (-> 
                    (nth input 6)
                    (str/replace "," ""))
             :opn_pri (nth input 7)
             :hgt_pri (nth input 8)
             :low_pri (nth input 9)
             :vol_tt (-> 
                       (nth input 10)
                       (str/replace "," ""))
             :frg_buy (-> 
                        (nth input 11)
                        (str/replace "," ""))
             :frg_sel (-> 
                        (nth input 12)
                        (str/replace "," ""))}))
     (vec))
