;; @@
(jdbc/insert-multi!
   db-conf
   :gcm_prices_mas
   (->> 
     hpgdata
     (filter #(= (count %) 13))
     (map (fn 
            [input]
            {:code "HPG"
             :date (->>
                     (nth input 1)
                     (f/parse (f/formatter "dd-mm-yyyy"))
                     (f/unparse (f/formatter "yyyymmdd")))
             :ref_pri (nth input 2)
             :chg (nth input 3)
             :chg_per (->
                        (nth input 4)
                        (str/replace "%" ""))
             :cls_pri (nth input 5)
             :vol (-> 
                    (nth input 6)
                    (str/replace "," ""))
             :opn_pri (nth input 7)
             :hgt_pri (nth input 8)
             :low_pri (nth input 9)
